import React from 'react'
import { Pagination, Typography, Box } from '@mui/material'

const Exercises = ({exercise,setExercises,bodyPart}) => {
  return (
    <Box id="exercises"
    sx={{mt:{lg:'110px'}}}
    mt="50px"
    p="20px"
    >
      <Typography></Typography>
    </Box>
  )
}

export default Exercises
